import React from 'react'
import Checkbox from './Components/Checkbox';
import Input from './Components/Input';
import Select from './Components/Select';
import Calendar from './Components/Calendar';
import Label from './Components/Label';
import EmptyArea from './Components/EmptyArea';
import MultiCheckBox from './Components/MultiCheckBox';
import Listbox from './Components/ListBox';
import Option from './Components/Option';
const Element = ({ field: { fieldType, filedId, fieldLabel, fieldPlaceholder, filedValue, fieldOptions, fieldSize, fieldSelect } }) => {

    switch (fieldType) {
        case 'text':
            return (<Input
                filedId={filedId}
                fieldLabel={fieldLabel}
                fieldPlaceholder={fieldPlaceholder}
                filedValue={filedValue}
                fieldSize={fieldSize}
            />)
        case 'select':
            return (<Select
                filedId={filedId}
                fieldLabel={fieldLabel}
                fieldPlaceholder={fieldPlaceholder}
                filedValue={filedValue}
                fieldOptions={fieldOptions}
                fieldSize={fieldSize}
            />)
        case 'checkbox':
            return (<Checkbox                
                fieldLabel={fieldLabel}
                filedValue={filedValue}
                fieldSize ={fieldSize}
                filedId={filedId}
            />)
        case 'date':
            return (<Calendar
                filedId={filedId}
                fieldLabel={fieldLabel}
                filedValue={filedValue}
                fieldSize={fieldSize}
            />)
        case 'label':
            return (<Label
                filedId={filedId}
                fieldLabel={fieldLabel}
                filedValue={filedValue}
                fieldSize={fieldSize}
            />)
        case 'empty':
            return (<EmptyArea              
                fieldSize={fieldSize}
            />)
        case 'multiselect':
            return (<MultiCheckBox                
                fieldOptions={fieldOptions}
                fieldSelect ={fieldSelect}
                filedId={filedId}
                fieldSize={fieldSize}
                fieldLabel={fieldLabel}
            />)
        case 'listbox':
            return (<Listbox                
                fieldOptions={fieldOptions}
                filedValue={filedValue}
                fieldLabel={fieldLabel}          
            />)
        case 'radio':
            return (<Option                
                fieldOptions={fieldOptions}       
                filedId={filedId}
            />)
        default:
            return null;
    }


}

export default Element
